INSERT INTO `Filme` (`Id`, `Nome`, `Duracao`, `DataLancamento`, `IdDiretor`, `Sinopse`, `Foto`, `Trailer`) VALUES
(1, 'MORTAL KOMBAT', '01:50:00', '2021-05-20', 3, 'Em Mortal Kombat, Shang Tsung, imperador da Exoterra, envia seu melhor guerreiro, Sub-Zero, para assassinar o jovem Cole Young. Temendo pela segurança da família, Cole vai em busca de Sonya Blade seguindo a indicação de Jax, um major das Forças Especiais, que tem a mesma estranha marca de dragão com a qual Cole nasceu. Logo, ele se vê no templo do Lorde Raiden, um Deus Ancião e guardião do Plano Terreno, que abriga todos que possuem a marca. No templo, ele treina com os experientes guerreiros Liu Kang, Kung Lao e Kano, enquanto se prepara para lutar contra os inimigos da Exoterra em uma batalha pelo universo. Será que Cole irá longe o suficiente para desbloquear sua arcana - o imenso poder da sua alma - a tempo de salvar não apenas a família, mas interromper os planos de Shang Tsung de uma vez por todas?', , 'https://www.youtube.com/embed/yzWWSKn_D14');
INSERT INTO `Filme` (`Id`, `Nome`, `Duracao`, `DataLancamento`, `IdDiretor`, `Sinopse`, `Foto`, `Trailer`) VALUES
(2, 'INVOCAÇÃO DO MAL 3: A ORDEM DO DEMÔNIO', '01:52:00', '2021-06-03', 4, 'Invocação do Mal 3: A Ordem do Demônio revela uma história assustadora de terror, assassinato e um desconhecido mal que chocou até os experientes investigadores de atividades paranormais Ed (Patrick Wilson) e Lorraine Warren (Vera Farmiga). Um dos casos mais sensacionais de seus arquivos, começa com uma luta pela alma de um garoto, depois os leva para além de tudo o que já haviam visto antes, para marcar a primeira vez na história dos Estados Unidos que um suspeito de assassinato alega ter tido uma possessão demoníaca como defesa.', , 'https://www.youtube.com/embed/Hn8GsjQTUiM');
INSERT INTO `Filme` (`Id`, `Nome`, `Duracao`, `DataLancamento`, `IdDiretor`, `Sinopse`, `Foto`, `Trailer`) VALUES
(3, 'CRUELLA', '02:14:00', '2021-05-27', 5, 'Ambientado na Londres dos anos 70 em meio à revolução do punk rock, o filme da Disney mostra a história de uma jovem vigarista chamada Estella (Emma Stone). Inteligente, criativa e determinada a fazer um nome para si através de seus designs, ela acaba chamando a atenção da Baronesa Von Hellman (Emma Thompson), uma lenda fashion que é devastadoramente chique e assustadora. Entretanto, o relacionamento delas desencadeia um curso de eventos e revelações que farão com que Estella abrace seu lado rebelde e se torne a Cruella, uma pessoa má, elegante e voltada para a vingança. ', , 'https://www.youtube.com/embed/ndDeNIOgsYo');
INSERT INTO `Filme` (`Id`, `Nome`, `Duracao`, `DataLancamento`, `IdDiretor`, `Sinopse`, `Foto`, `Trailer`) VALUES
(4, 'AQUELES QUE ME DESEJAM A MORTE', '01:40:00', '2021-05-27', 6, 'Em Aqueles que me Desejam a Morte, Connor é um menino de 12 anos que presencia o assassinato dos pais. Ele, então, precisa escapar dos assassinos que começam a caça-lo incessantemente. Ele encontra proteção com Hannah Faber (Angelina Jolie), uma bombeira  traumatizada pelo fracasso de sua última missão. Os dois vão precisar lutar muito para sobreviver.', , 'https://www.youtube.com/embed/TOMVgWohAbU');
INSERT INTO `Filme` (`Id`, `Nome`, `Duracao`, `DataLancamento`, `IdDiretor`, `Sinopse`, `Foto`, `Trailer`) VALUES
(5, 'GODZILLA VS KONG', '01:54:00', '2021-05-06', 7, 'No primeiro crossover do MonstroVerso, Kong e seus protetores embarcam em uma jornada perigosa para encontrar seu verdadeiro lar. Entretanto, tudo sai do controle quando um Godzilla enfurecido, começa a deixar um rastro de destruição pelo planeta. Esse combate épico entre os dois titãs, instigado por forças ocultas, é apenas o começo do mistério que jaz no núcleo da Terra. Será que o mundo sobreviverá ao duelo de monstros? \n', , 'https://www.youtube.com/embed/ZQA-Bg9MydE');
INSERT INTO `Filme` (`Id`, `Nome`, `Duracao`, `DataLancamento`, `IdDiretor`, `Sinopse`, `Foto`, `Trailer`) VALUES
(7, 'SENHOR DOS ANEIS: O RETORNO DO REI', '03:21:00', '2003-12-25', 10, 'O confronto final entre as forças do bem e do mal que lutam pelo controle do futuro da Terra Média se aproxima. Sauron planeja um grande ataque a Minas Tirith, capital de Gondor, o que faz com que Gandalf e Pippin partam para o local na intenção de ajudar a resistência. Um exército é reunido por Theoden em Rohan, em mais uma tentativa de deter as forças de Sauron. Enquanto isso, Frodo, Sam e Gollum seguem sua viagem rumo à Montanha da Perdição para destruir o anel.', , 'https://www.youtube.com/embed/LiKeQrChkTY');
INSERT INTO `Filme` (`Id`, `Nome`, `Duracao`, `DataLancamento`, `IdDiretor`, `Sinopse`, `Foto`, `Trailer`) VALUES
(8, 'JOGOS MORTAIS: O FINAL', '01:30:00', '2010-09-29', 12, 'Como uma batalha mortal sobre o brutal legado de Jigsaw, um grupo de sobreviventes se reúne para buscar o apoio do guru e companheiro sobrevivente Bobby Dagen, um homem cujos próprios segredos sombrios desatam uma nova onda de terror.', , 'https://www.youtube.com/embed/V1IwmygKN6c');

