INSERT INTO `Serie` (`Id`, `Nome`, `PrimeiroEpisodio`, `NumeroTemporada`, `DataTermino`, `Sinopse`, `IdCriador`, `Foto`, `Trailer`) VALUES
(1, 'SUPERNATURAL', '2005-09-13', 15, '2020-11-19', 'Desde que era pequeno, Sam Winchester (Jared Padalecki) tentava escapar do próprio passsado. Após a misteriosa morte de Mary (Samantha Smith), o pai de Sam passou a procurar vingança contra as forças do mal que mataram a esposa, destruindo qualquer ser maligno que cruze o seu caminho. Ao contrário de Sam, Dean (Jensen Ackles), seu irmão mais velho, sempre quis seguir os passos do pai. Sam parece determinado a se livrar do \"negócio da família\", mas sua vida está prestes a tomar um rumo indesejado quando não lhe resta outra escolha a não ser se unir ao irmão.', 1, , 'https://www.youtube.com/embed/gE4mgKBWZkE');
INSERT INTO `Serie` (`Id`, `Nome`, `PrimeiroEpisodio`, `NumeroTemporada`, `DataTermino`, `Sinopse`, `IdCriador`, `Foto`, `Trailer`) VALUES
(2, 'GAME OF THRONES', '2011-04-17', 8, '2019-05-19', 'Game of Thrones conta a históra de um lugar onde uma força destruiu o equilíbrio das estações, há muito tempo. Em uma terra onde os verões podem durar vários anos e o inverno toda uma vida, as reivindicações e as forças sobrenaturais correm as portas do Reino dos Sete Reinos. A irmandade da Patrulha da Noite busca proteger o reino de cada criatura que pode vir de lá da Muralha, mas já não tem os recursos necessários para garantir a segurança de todos. Depois de um verão de dez anos, um inverno rigoroso promete chegar com um futuro mais sombrio. Enquanto isso, conspirações e rivalidades correm no jogo político pela disputa do Trono de Ferro, o símbolo do poder absoluto.', 6, , 'https://www.youtube.com/embed/Tq8FKG_mDMw');
INSERT INTO `Serie` (`Id`, `Nome`, `PrimeiroEpisodio`, `NumeroTemporada`, `DataTermino`, `Sinopse`, `IdCriador`, `Foto`, `Trailer`) VALUES
(3, 'GREY\'S ANATOMY', '2005-03-27', 18, '0000-00-00', 'Em Grey\'s Anatomy, os médicos do Grey Sloan Memorial Hospital/Seattle Grace Hospital lidam diariamente com casos de vida ou morte. É um no outro que eles encontram apoio, conforto, amizade e até mesmo amor. Juntos, eles se esforçam para conciliar os dramas profissionais com os pessoais, descobrindo que ambos podem - e vão - se misturar no meio do caminho. Entre os funcionários do local está Meredith Grey (Ellen Pompeo), filha de um cirurgião conceituado que acaba de entrar para o programa de residência. Ela divide as preocupações do ofício com os internos Cristina Yang (Sandra Oh), Izzie Stevens (Katherine Heigl), Alex Karev (Justin Chambers) e George O\'Malley (T. R. Knight). Todos passam pela supervisão de três renomados doutores: Miranda Bailey (Chandra Wilson), uma residente sênior que trabalha para ajudar Derek Shepherd (Patrick Dempsey), chefe de neurocirurgia e interesse amoroso de Grey; Preston Burke (Isaiah Washington), chefe do departamento de cardio e futuro noivo de Yang; e ', 2, , 'https://www.youtube.com/embed/hu7Xnmgun0E');
INSERT INTO `Serie` (`Id`, `Nome`, `PrimeiroEpisodio`, `NumeroTemporada`, `DataTermino`, `Sinopse`, `IdCriador`, `Foto`, `Trailer`) VALUES
(4, 'SWEET TOOTH', '2021-06-04', 1, '0000-00-00', 'Produzida por Robert Downey Jr. e baseada na série homônima de HQs da Vertigo (selo da DC Comics), Sweet Tooth conta a história de Gus (Christian Convery), um menino-cervo que vive em um futuro pós-apocalíptico e faz parte de uma nova raça híbrida de humanos e animais. Isso é resultado de uma série de mutações que aconteceram depois do \"Grande Colapso\", quando um misterioso e mortal vírus espalhou o caos pelo mundo. Devido à pandemia, Gus cresceu isolado por uma década, até que decide deixar sua casa na floresta para explorar o que restou lá fora e encontrar sua mãe desaparecida. Mas, contra todas as probabilidades, ele se torna amigo do ex-jogador de futebol Tommy Jepperd (Nonso Anozie), agora viajante solitário e um dos sobreviventes da catástrofe. Juntos, eles embarcam em uma aventura extraordinária por um planeta devastado – e perigoso. Ao descobrir que existem outros como ele, Gus acaba ingressando em uma família de híbridos enquanto busca por respostas acerca dessa nova realidade', 5, , 'https://www.youtube.com/embed/0mz_ImwSOpM');
INSERT INTO `Serie` (`Id`, `Nome`, `PrimeiroEpisodio`, `NumeroTemporada`, `DataTermino`, `Sinopse`, `IdCriador`, `Foto`, `Trailer`) VALUES
(5, 'LUCIFER', '2016-01-25', 6, '0000-00-00', 'Lucifer Morningstar (Tom Ellis), o famigerado Senhor do Inferno, se cansa da vida demoníaca que leva no subterrâneo e abandona seu trono para tirar férias em Los Angeles. Lá, ele abre uma casa noturna chamada \"Lux\" e passa a desfrutar de tudo o que mais gosta: vinho, mulheres e excessos. Sua nova rotina se complica quando uma estrela do pop é brutalmente assassinada diante de seus olhos. Pela primeira vez em mais de 10 milhões de anos, Lucifer sente despertar em seu interior um desejo de justiça e resolve punir os responsáveis pelo crime. Ele conhece, então, a policial Chloe Decker (Lauren German) e se junta a ela para desvendar o caso. Mas seus poderes de persuasão se mostram tão úteis que ele se torna uma espécie de consultor em outras investigações de homicídio, formando uma dupla improvável com Chloe.', 3, , 'https://www.youtube.com/embed/Nu5z3AT2jv8');
INSERT INTO `Serie` (`Id`, `Nome`, `PrimeiroEpisodio`, `NumeroTemporada`, `DataTermino`, `Sinopse`, `IdCriador`, `Foto`, `Trailer`) VALUES
(6, 'THE WALKING DEAD', '2010-10-31', 11, '0000-00-00', 'Em The Walking Dead, um apocalipse provoca uma infestação de zumbis na cidade de Cynthiana, em Kentucky, nos Estados Unidos, e o oficial de polícia Rick Grimes (Andrew Lincoln) descobre que os mortos-vivos estão se propagando progressivamente. Ele decide unir-se aos homens e mulheres sobreviventes para que tenham mais força para combater o fenômeno que os atinge. O grupo percorre diferentes lugares em busca de soluções para o problema.', 4, , 'https://www.youtube.com/embed/6Z6ijZa3EXw');

